import React, { Component } from "react";
import "./counter.css";
import Icon from "react-native-vector-icons/FontAwesome";
class Counter extends Component {
  render() {
    return (
      <div class="header">
        <h1>CINEPHILE</h1>{" "}
        <div class="searchbar">
          <input
            type="text"
            id="myInput"
            onkeyup="myFunction()"
            placeholder="Enter movie Name here"
          ></input>
        </div>
        <Icon name="search" size={24} />
      </div>
    );
  }
}

export default Counter;
